import React from "react";
import { toAbsoluteUrl } from "../../../../../../../../../_metronic/_helpers";
import SVG from "react-inlinesvg";
import { Card } from "react-bootstrap";
import { CardBody } from "../../../../../../../../../_metronic/_partials/controls";
import FormControlLabel from '@material-ui/core/FormControlLabel';
import IOSSwitch from '../../../../../../../../pages/IOSSwitch';

export default function PickingList({pickingList}) {
    const handleSelectPickingList = (event, number) => {
        let id = "picking-id-" + number;
        const getId = document.getElementById(id);
        const getElements = document.getElementsByClassName('picking-list-div');

        let spanId = "picking-list-normal-span-id-" + number;
        const getSpanId = document.getElementById(spanId);
        const getSpanElements = document.getElementsByClassName('picking-list-normal-span');

        for (var i = 0; i < getElements.length; i++) {
            getElements[i].classList.remove('select-order-list');
        }

        if (getId) {
            getId.classList.add('select-order-list');
        }
        for (var i = 0; i < getSpanElements.length; i++) {
            getSpanElements[i].classList.remove('picking-list-select-span');
        }

        if (getSpanId) {
            getSpanId.classList.add('picking-list-select-span');
        }
    }
    return (
        <>
            {/* TITLE ROW */}
            <div>
                {/* PICKING LIST TITLE CARD */}
                <Card style={{ borderTopRightRadius: "30px", borderTopLeftRadius: "30px" }}>
                    <CardBody>
                        <div className="row no-gutters">
                            <div className="col-10">
                                <span className="text-muted">Title</span><br />
                                <strong>Picking List</strong>
                            </div>
                            <div className="col-2">
                                <FormControlLabel
                                    control={<IOSSwitch disabled />}
                                />
                            </div>
                        </div>
                        <div>
                            <span className="text-muted"><strong>List</strong></span>
                            <span className="text-muted float-right"><strong>Status</strong></span>
                        </div>
                    </CardBody>
                </Card>
            </div>

            {/* PICKING LIST DATA VIEW ROW */}
            {
                pickingList.map((data) => (
                    <>
                        <div className="mt-5 picking-list-div" style={{ cursor: "pointer" }} onClick={(event) => handleSelectPickingList(event, 0)} id={"picking-id-" + 0}>
                            <Card>
                                <CardBody>
                                    <div>
                                        <span id={"picking-list-normal-span-id-" + 0} className="float-right picking-list-normal-span"><strong>15</strong></span>
                                        <span className="text-muted">Picking ID.</span><br />
                                        <strong>54123697</strong>
                                    </div>
                                    <div className="mt-5">
                                        <span className="text-muted">Date</span><br />
                                        <strong>12 APR 2022 10:13 AM</strong>
                                    </div>
                                </CardBody>
                            </Card>
                        </div>
                        <div className="mt-5 picking-list-div" style={{ cursor: "pointer" }} onClick={(event) => handleSelectPickingList(event, 1)} id={"picking-id-" + 1}>
                            <Card>
                                <CardBody>
                                    <div>
                                        <span id={"picking-list-normal-span-id-" + 1} className="float-right picking-list-normal-span"><strong>15</strong></span>
                                        <span className="text-muted">Order No.</span><br />
                                        <strong>54123697(12 APR 2022 10:13 AM)</strong>
                                    </div>
                                    <div className="mt-5">
                                        <span className="text-muted">Booking No.</span><br />
                                        <strong>54123697</strong>
                                        <span className="float-right"><SVG src={toAbsoluteUrl("/media/svg/icons/project-svg/delivery.svg")} /></span><br />
                                    </div>
                                </CardBody>
                            </Card>
                        </div>
                        <div className="mt-5 picking-list-div" style={{ cursor: "pointer" }} onClick={(event) => handleSelectPickingList(event, 2)} id={"picking-id-" + 2}>
                            <Card>
                                <CardBody>
                                    <div>
                                        <span id={"picking-list-normal-span-id-" + 2} className="float-right picking-list-normal-span"><strong>15</strong></span>
                                        <span className="text-muted">Order No.</span><br />
                                        <strong>54123697(12 APR 2022 10:13 AM)</strong>
                                    </div>
                                    <div className="mt-5">
                                        <span className="text-muted">Amount</span><br />
                                        <strong>789,530,000</strong>
                                        <span className="float-right"><SVG src={toAbsoluteUrl("/media/svg/icons/project-svg/green-car.svg")} /></span><br />
                                    </div>
                                </CardBody>
                            </Card>
                        </div>
                    </>
                ))
            }
        </>
    )
}
